foreach ($url in $urls)
{
    $out = $url.Split('/')[-1].Replace('%20', ' ')

    if (Test-Path $out) { continue }

    # download files from url
    $file = Invoke-WebRequest -Uri $url -OutFile $out

    # if file is smaller than 4kb, write url to file log.txt
    if ((Get-Item $out).Length -lt 4096) 
    { 
        Add-Content log.txt $url+"\n"
        Remove-Item $out
    }
}
